import React, {Component} from 'react'
import { Link } from 'react-router-dom';

class Button extends Component {
    constructor(props) {
        super(props)
        this.state = {}
    }
    render() {
        return (
            <Link to = {this.props.route}>
                <button> {props.name} </button>
            </Link>
        )
    }
}

export default Button
